webpackJsonp([0x9ae13f919ada],{6539:function(t,e){t.exports={data:{post:{html:'<p><img alt="crh_stocking.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2003/12/crh_stocking.jpg" width="320" height="218" border="0" /></p>\n<p>Grandma sent Christopher a Christmas stocking. Since he\'s not familiar with American Christmas customs, he thought he had to wear it.</p>\n<p>We\'ll set it out for the <a href="http://www.training-for-germany.de/tips99/tip11.htm">Nikolaus</a> tonight. He\'s coming to our house a day late this year, and he\'s been informed to expect a stocking instead of a shoe. (The exact date doesn\'t matter, since Christopher is already a few days ahead with his Advent calendar.)</p>',fields:{title:"Christmas Stocking",date:"06 Dec 2003",url:"https://papascott.de/2003-12-06-christmas-stocking/"}}},pathContext:{slug:"/2003-12-06-christmas-stocking/",prev:{fields:{title:"I nearly forgot my fourth weblog anniversary",date:"05 Dec 2003",slug:"/2003-12-05-i-nearly-forgot-my-fourth-weblog-anniversary/"}},next:{fields:{title:"Goodbye Lenin sweeps Europe Film Prize",date:"07 Dec 2003",slug:"/2003-12-07-goodbye-lenin-sweeps-europe-film-prize/"}}}}}});
